def transform(sequence):
    zeros = sequence.count('0')
    non_zeros = len(sequence) - zeros
    return '0'*zeros + '7'*non_zeros if sequence[0] == '7' else '0'*zeros + sequence.replace('0', '3', 1)

def transform(sequence):
    count = 0
    transformed_sequence = ''
    for num in sequence:
        if num == '0':
            count += 1
        else:
            transformed_sequence += num

    return '0'*count + transformed_sequence + '0'*(len(sequence)-count-len(transformed_sequence))

def transform(sequence):
    count_zero = sequence.count('0')
    count_other = len(sequence) - count_zero
    return ('0' * count_zero) + ('7' * count_other) + ('0' * count_zero)

def transform(sequence):
    count = 0
    for num in sequence:
        if num != '0':
            break
        count += 1
    return sequence[count:] + '0'*count + '0'*(len(sequence)-len(sequence[count:]) - count)
